    "contracts/token/CLZToken.sol": {
      "content": "// SPDX-License-Identifier: MIT

pragma solidity 0.7.6;

import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "../core/SafeOwnable.sol";
import "hardhat/console.sol";

contract CLZToken is ERC20, SafeOwnable {
    using SafeMath for uint256;
    using Address for address;

    event BindReferrer(address user, address inviter);
    event MinterChanged(address indexed minter, uint256 maxAmount);

    uint256 public constant MAX_SUPPLY = 100000 * 10**18;
    address public constant BURN_ADDRESS =
        0x000000000000000000000000000000000000dEaD;
    uint256 FEE_BASE = 1e6;

    mapping(address => address) public referrers;
    mapping(address => address[]) public _recommended;
    mapping(address => uint256) public minters;
    mapping(uint256 => uint256) public referralFeePercent;
    mapping(address => bool) public _isExcludedFrom;
    uint256 public minRewardLimit = 1000000000000000000;
    uint256 public burnFeePercent = 30000;
    uint256 public nodeFeePercent = 10000;
    uint256 public pairFeePercent = 30000;
    uint256 public nodeReferralFeePercent = 10000;

    address public reserve;
    address public nodeRewardReciver;
    address public pairRewardReciver;

    constructor(address reserve_) ERC20("CLZ Token", "CLZ") {
        reserve = reserve_;

        referralFeePercent[1] = 30000;
        referralFeePercent[2] = 5000;
        referralFeePercent[3] = 5000;
        referralFeePercent[4] = 5000;
        referralFeePercent[5] = 5000;

        _isExcludedFrom[msg.sender] = true;
        _mint(msg.sender, MAX_SUPPLY);

        _bindReferrers(msg.sender, address(this));
    }

    function excludeFrom(address account) external onlyOwner {
        _isExcludedFrom[account] = true;
    }

    function includeInFrom(address account) external onlyOwner {
        _isExcludedFrom[account] = false;
    }

    function setNodeRewardReciver(address nodeRewardReciver_)
        external
        onlyOwner
    {
        nodeRewardReciver = nodeRewardReciver_;
        _isExcludedFrom[nodeRewardReciver] = true;
    }

    function setPairRewardReciver(address pairRewardReciver_)
        external
        onlyOwner
    {
        pairRewardReciver = pairRewardReciver_;
        _isExcludedFrom[pairRewardReciver] = true;
    }

    function setReserve(address _reserve) external onlyOwner {
        reserve = _reserve;
    }

    function setMinRewardLimit(uint256 _minRewardLimit) external onlyOwner {
        minRewardLimit = _minRewardLimit;
    }

    function setReferralFeePercent(uint256 level, uint256 _feePercent)
        external
        onlyOwner
    {
        referralFeePercent[level] = _feePercent;
    }

    function setNodeReferralFeePercent(uint256 _nodeReferralFeePercent)
        external
        onlyOwner
    {
        nodeReferralFeePercent = _nodeReferralFeePercent;
    }

    function setPairFeePercent(uint256 _pairFeePercent) external onlyOwner {
        pairFeePercent = _pairFeePercent;
    }

    function setNodeFeePercent(uint256 _nodeFeePercent) external onlyOwner {
        nodeFeePercent = _nodeFeePercent;
    }

    function setBurnFeePercent(uint256 _burnFeePercent) external onlyOwner {
        burnFeePercent = _burnFeePercent;
    }

    function bindReferrers(address _user, address _inviter) internal {
        if (
            referrers[_user] != address(0) || referrers[_inviter] == address(0)
        ) {
            return;
        }
        if (_user.isContract() || _inviter.isContract()) {
            return;
        }
        _bindReferrers(_user, _inviter);
    }

    function _bindReferrers(address _user, address _inviter) internal {
        referrers[_user] = _inviter;
        _recommended[_inviter].push(_user);
        emit BindReferrer(_user, _inviter);
    }

    function calculateTokenFee(
        address _sender,
        address _recipient,
        uint256 _amount
    ) internal returns (uint256 _remainAmount) {
        _remainAmount = _amount;
        if (balanceOf(BURN_ADDRESS) < 90000 * 10**decimals()) {
            uint256 burnAmount = _amount.mul(burnFeePercent).div(FEE_BASE);
            _remainAmount = _remainAmount.sub(burnAmount);
            super._transfer(_sender, BURN_ADDRESS, burnAmount);
        }
        if (nodeRewardReciver != address(0)) {
            uint256 nodeAmount = _amount.mul(nodeFeePercent).div(FEE_BASE);
            _remainAmount = _remainAmount.sub(nodeAmount);
            super._transfer(_sender, nodeRewardReciver, nodeAmount);
            if (nodeRewardReciver.isContract()) {
                nodeRewardReciver.functionCall(
                    abi.encodeWithSignature("sync()", "node sync call faild")
                );
            }
        }
        if (pairRewardReciver != address(0)) {
            uint256 pairAmount = _amount.mul(pairFeePercent).div(FEE_BASE);
            _remainAmount = _remainAmount.sub(pairAmount);
            super._transfer(_sender, pairRewardReciver, pairAmount);
            if (pairRewardReciver.isContract()) {
                pairRewardReciver.functionCall(
                    abi.encodeWithSignature("sync()"),
                    "pair sync call faild"
                );
            }
        }
        uint256 nodeReferralAmount = _amount.mul(nodeReferralFeePercent).div(
            FEE_BASE
        );
        _remainAmount = _remainAmount.sub(nodeReferralAmount);
        address referrer = referrers[_sender];
        if (referrer != address(0) && nodeRewardReciver.isContract()) {
            bytes memory returndata = address(nodeRewardReciver).functionCall(
                abi.encodeWithSignature("balanceOf(address)", referrer)
            );
            uint256 balance = abi.decode(returndata, (uint256));
            if (balance > 0) {
                super._transfer(_sender, referrer, nodeReferralAmount);
            } else {
                super._transfer(_sender, reserve, nodeReferralAmount);
            }
        } else {
            super._transfer(_sender, reserve, nodeReferralAmount);
        }
        address caller = _sender;
        if (caller.isContract()) {
            caller = _recipient;
        }
        uint256 referralAmount = referralReward(_sender, caller, _amount);
        _remainAmount = _remainAmount.sub(referralAmount);
    }

    function referralReward(
        address sender,
        address account,
        uint256 value
    ) internal returns (uint256 totalReward) {
        for (uint256 i = 1; i <= 5; i++) {
            account = referrers[account];
            uint256 _reward = value.mul(referralFeePercent[i]).div(FEE_BASE);
            totalReward = totalReward.add(_reward);
            if (account != address(0) && balanceOf(account) >= minRewardLimit) {
                super._transfer(sender, account, _reward);
            } else {
                super._transfer(sender, reserve, _reward);
            }
        }
    }

    function _transfer(
        address _sender,
        address _recipient,
        uint256 _amount
    ) internal virtual override {
        bindReferrers(_recipient, _sender);
        if (!_isExcludedFrom[_sender] && !_isExcludedFrom[_recipient]) {
            _amount = calculateTokenFee(_sender, _recipient, _amount);
        }
        super._transfer(_sender, _recipient, _amount);
    }

    function recommended(
        address account,
        uint256 page,
        uint256 size
    ) public view returns (uint256 number, address[] memory) {
        uint256 len = size;
        if (page * size + size > _recommended[account].length) {
            len = _recommended[account].length % size;
        }
        address[] memory _fans = new address[](len);
        uint256 startIdx = page * size;
        for (uint256 i = 0; i != size; i++) {
            if (startIdx + i >= _recommended[account].length) {
                break;
            }
            _fans[i] = _recommended[account][startIdx + i];
        }
        return (_recommended[account].length, _fans);
    }
}
"
